import React from 'react';


const SlotM = (props) => {
    // let x = 'ðŸ˜„';
    // let y = 'ðŸ˜„';
    // let z = 'ðŸ˜„';
  
    //  let x = props.x
    //  let y = props.y
    //  let z = props.z

     let { x, y, z } = props;
  
    if ( (x===y) && (y===z) ) {
      return(
        <>
           <div className='slot_inner'>
  
           <h1> {x} {y} {z} </h1>
           <h1> This is macthing. </h1>
           <hr />
           </div>
  
        </>
      );
    }else{
      return(
        <>
           <div className='slot_inner'>
  
           <h1> {x} {y} {z} </h1>
           <h1> This is not macthing. </h1>
           <hr />
           </div>
  
        </>
      );
    }
  };
  
export default SlotM;
